    "2015-09-26T21:28:42.171016",nt"name": "2003-oahu-coastline-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "LIDAR data is remotely sensed high-resolution
    elevation data collected by an airborne collection platform. Using a combination
    of laser rangefinding, GPS positioning and inertial measurement technologies; LIDAR
    instruments are able to make highly detailed Digital Elevation Models (DEMs) of
    the earth's terrain, man-made structures and vegetation. This data was collected
    over a 100 meter swath of the Oahu, Hawaii coastline with a Leica ALS-40 Aerial
    Lidar Sensor. Multiple returns were recorded for each pulse in addition to an intensity
    value.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
